import React, {Component} from 'react';
import Conn from "./Conn";

class Connect extends Component {
    constructor(props){
        super(props);
        const state = {
            bgimg : '../img/design.jpg'
        }
    }
    render() {

        var imgUrl_2 = '';
        const style_2 = {
            backgroundImage: 'url("'+imgUrl_2+'")',
            backgroundSize: 'cover',
            backgroundPosition: 'center center',
        };
        var imgUrl_3 = '../img/build.png';
        const style_3 = {
            backgroundImage: 'url("'+imgUrl_3+'")',
            backgroundSize: 'cover',
            backgroundPosition: 'center center',
        };
        var imgUrl_4 = '../img/domain.png';
        const style_4 = {
            backgroundImage: 'url("'+imgUrl_4+'")',
            backgroundSize: 'cover',
            backgroundPosition: 'center center',
        };
        var imgUrl_5 = '../img/host.jpg';
        const style_5 = {
            backgroundImage: 'url("'+imgUrl_5+'")',
            backgroundSize: 'cover',
            backgroundPosition: 'center center',
        };
        var imgUrl_6 = '../img/seotop.jpg';
        const style_6 = {
            backgroundImage: 'url("'+imgUrl_6+'")',
            backgroundSize: 'cover',
            backgroundPosition: 'center center',
        };

        return (

            <div className="container" data-aos="fade-up">
                <div className="row">
                    <div className="col-lg-12">
                        <ul className="timeline">
                        <Conn connclass="" style={style_2}  conntitle="Design" conncontent="Thiết kế web theo đúng yêu cầu, hỗ trợ responsive. Hoàn thành trong thời gian ngắn nhất luôn đảm bảo hợp đồng. Tuỳ chỉnh thiết kế theo ý khách hàng trong thời gian hợp đồng" line="line"/>
                        <Conn connclass="timeline-inverted" style={style_3}  conntitle="Building" conncontent="Xây dựng nhanh, hỗ trợ các công nghê mới nhất đảm bảo chất lượng trang web cả về giao diện lẫn cấu trúc" line="line"/>
                        <Conn connclass="" conntitle="Domain" style={style_4} conncontent="Cung cấp các gói tên miền giá rẻ nhất cho bạn tuỳ ý lựa chọn, tư vấn miễn phí với khách hàng về domain" line="line"/>
                        <Conn connclass="timeline-inverted" style={style_5}  conntitle="Hosting" conncontent="Dịch vụ hosting hàng đầu đảm bảo cho trang web của bạn up time với thời gian gần như tuyệt đối" line="line"/>
                        <Conn connclass="" style={style_6} conntitle="SEO" conncontent="Với kinh nghiệm của các chuyên gia về SEO chúng tôi cam kết mang lại cho bạn những vị trí cao trên goodle tìm kiếm với giá hợp lý nhất" line=""/>
                        </ul>
                    </div>
                </div>
            </div>

        );
    }
}

export default Connect;
